import { useState } from "react";
import {
  Box,
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Button,
  Stack,
} from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import SellIcon from "@mui/icons-material/Sell";

// Mock data for active auctions
const activeAuctions = [
  {
    id: 1,
    title: "2020 Tesla Model S",
    image: "https://source.unsplash.com/random/800x600/?tesla",
    currentPrice: 45000,
    timeLeft: "2 days",
  },
  {
    id: 2,
    title: "2019 Porsche 911",
    image: "https://source.unsplash.com/random/800x600/?porsche",
    currentPrice: 82000,
    timeLeft: "4 hours",
  },
  {
    id: 3,
    title: "2021 BMW M4",
    image: "https://source.unsplash.com/random/800x600/?bmw",
    currentPrice: 65000,
    timeLeft: "1 day",
  },
  {
    id: 4,
    title: "2018 Mercedes-Benz AMG GT",
    image: "https://source.unsplash.com/random/800x600/?mercedes",
    currentPrice: 75000,
    timeLeft: "3 days",
  },
];

const Home = () => {
  const [isConnected, setIsConnected] = useState(false);

  const handleStartSelling = async () => {
    try {
      const response = await fetch("http://127.0.0.1:8000/playground/hello/");
      if (response.ok) {
        console.log("Connected");
        setIsConnected(true);
      }
    } catch (error) {
      console.error("Connection failed:", error);
      setIsConnected(false);
    }
  };

  return (
    <Box sx={{ flexGrow: 1, py: 4, backgroundColor: "#f5f5f5" }}>
      <Container maxWidth="lg">
        {/* Hero Section */}
        <Box sx={{ mb: 6, textAlign: "center" }}>
          <Typography variant="h3" component="h1" gutterBottom color="#1a1a1a">
            Find Your Dream Car
          </Typography>
          <Typography variant="h6" color="text.secondary" sx={{ mb: 4 }}>
            Discover exclusive auctions for luxury and classic cars
          </Typography>
          <Stack
            direction={{ xs: "column", sm: "row" }}
            spacing={2}
            justifyContent="center"
          >
            <Button
              variant="contained"
              size="large"
              startIcon={<ShoppingCartIcon />}
              sx={{
                backgroundColor: "#ff0000",
                "&:hover": {
                  backgroundColor: "#cc0000",
                },
              }}
            >
              Browse Auctions
            </Button>
            <Button
              variant="outlined"
              size="large"
              startIcon={<SellIcon />}
              onClick={handleStartSelling}
              sx={{
                borderColor: isConnected ? "#00cc00" : "#ff0000",
                color: isConnected ? "#00cc00" : "#ff0000",
                "&:hover": {
                  borderColor: isConnected ? "#009900" : "#cc0000",
                  backgroundColor: isConnected
                    ? "rgba(0, 204, 0, 0.04)"
                    : "rgba(255, 0, 0, 0.04)",
                },
              }}
            >
              Start Selling
            </Button>
          </Stack>
        </Box>

        {/* Active Auctions Grid */}
        <Typography variant="h4" component="h2" sx={{ mb: 4 }} color="#1a1a1a">
          Active Auctions
        </Typography>
        <Grid container spacing={4}>
          {activeAuctions.map((auction) => (
            <Grid item key={auction.id} xs={12} sm={6} md={3}>
              <Card
                sx={{
                  height: "100%",
                  display: "flex",
                  flexDirection: "column",
                  transition: "transform 0.2s",
                  "&:hover": {
                    transform: "scale(1.02)",
                  },
                }}
              >
                <CardMedia
                  component="img"
                  height="200"
                  image={auction.image}
                  alt={auction.title}
                />
                <CardContent sx={{ flexGrow: 1 }}>
                  <Typography gutterBottom variant="h6" component="h3">
                    {auction.title}
                  </Typography>
                  <Typography variant="h6" color="#ff0000" gutterBottom>
                    ${auction.currentPrice.toLocaleString()}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Time left: {auction.timeLeft}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default Home;
